module sapPotential
  use params, only : IPREC, PREC
contains
!  Lagrange interpolation
function lagrange_interpolation(xi, yi, x) result(y)
  implicit none
  real*8, dimension(:), intent(in) :: xi
  real*8, dimension(:), intent(in) :: yi
  real*8, intent(in) :: x

  real*8 :: y, li
  integer (KIND=IPREC) :: i, j

  ! Perform the interpolation
  y = 0.0_8
  do i=1,size(xi)
    ! Compute the i:th polynomial
    li = 1.0_8
    do j=1,size(xi)
      if(i .eq. j) cycle
      li = li * (x-xi(j)) / (xi(i)-xi(j))
    end do
    ! Increment y
    y = y + yi(i)*li
  end do
end function lagrange_interpolation

! Array lookup
function array_lookup(array, Z, x) result(y)
  implicit none
  real*8, intent(in), dimension(:,:) :: array
  integer (KIND=IPREC),intent(in) :: Z
  real*8, intent(in) :: x
  real*8 :: y
  
  integer (KIND=IPREC) :: i
  integer (KIND=IPREC) :: posleft, posright, posmiddle
  ! lip_order<=4 provides safe interpolation; higher values lead to +/-Infinity at some grid points
  integer (KIND=IPREC) :: lip_order = 3
  common /sap4interp/ lip_order
  real*8, dimension(lip_order) :: xi, yi
  
  if(Z < 1) then
     y=0.0_8
  else if(Z+1 > size(array,2)) then
     y=0.0_8
  else if(x <= array(1,1)) then
     y=array(1,Z+1)
  else if(x >= array(size(array,1),1)) then
     y=array(size(array,1),Z+1)
  else
     posleft=1
     posright=size(array,1)
     do while(.true.)
        posmiddle=(posleft+posright)/2
        if(array(posmiddle,1) .lt. x) then
           posleft=posmiddle
        else
           posright=posmiddle
        end if
        if(posright .eq. posleft+1) then
           exit
        end if
     end do
     
     if(posleft + lip_order > size(array,1)) then
        posleft = posleft - (posleft + lip_order) + size(array,1)
     end if
     
     do i=1,lip_order
        xi(i) = array(posleft+i-1,1)
        yi(i) = array(posleft+i-1,Z+1)
     end do
     
     y = lagrange_interpolation(xi,yi,x);
  end if
end function array_lookup

!  Routines for the implementation of the superposition of atomic
!  potentials guess for electronic structure calculations, see
!
!  S. Lehtola, "Assessment of Initial Guesses for Self-Consistent Field
!  Calculations. Superposition of Atomic Potentials: Simple yet
