function effective_charge(Z,r) result(V)
 implicit none
 integer (KIND=IPREC),intent(in) :: Z
 real*8, intent(in) :: r
 real*8 :: V
 real*8, dimension(751,119) :: sap_potential_ec
 V = array_lookup(sap_potential_ec, Z, r)
end function effective_charge

! Same as above, but only for the Coulomb part; gives a good initial
! guess for the Coulomb potential. Only electronic contribution is
! included.
function effective_coulomb_charge(Z,r) result(V)
 implicit none
 integer (KIND=IPREC),intent(in) :: Z
 real*8, intent(in) :: r
 real*8 :: V
 real*8, dimension(751,119) :: sap_potential_ecc
 V = array_lookup(sap_potential_ecc, Z, r)
end function effective_coulomb_charge
end module sapPotential
